export default (function(a,b,c,d,e){return {data:{C1miPRF3C5:{data:{id:331,attributes:{imdbId:"tt0074212",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYWJmYjEzMjMtYTc0NC00MjBjLWE5OGYtYTJjZTA5YWRlZTYwXkEyXkFqcGdeQXVyNjM2NTM3ODA@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.1\u002F10"}],item_lang:{data:{id:994,attributes:{title:c,plot:"The young Ramon Salazar, son of a village owner, dreams of becoming a pearl fisherman. His father agrees to let him experience this job. Ramon enters a forbidden cave, den of a giant skate nicknamed the Manta Diablo. He finds an oyster containing a black pearl of unusual size. His father donates it to the Virgin rather than sell it to dishonest traffickers. Shortly after, the flotilla of the village led by Salazar perishes at sea. Ramon must face the Manta Diablo with another fisherman to bring prosperity to the village ..",slug:"the-black-pearl"}}},books:{data:[{id:3111,attributes:{title:c,description:"A sixteen-year-old boy relates his discovery of the Pearl of Heaven and his near-fatal encounter with the feared sea monster, Manta Diablo.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=mu0jtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2010-01-01",publisher:"HMH Books For Young Readers",subtitle:a}},{id:3112,attributes:{title:c,description:"In claiming as his own the magnificent black pearl he finds, a sixteen-year-old youth enrages the sea devil who legend says is its owner.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yUZ25SkumKQC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1996-03-01",publisher:"Bantam Doubleday Dell Publishing Group",subtitle:a}},{id:3113,attributes:{title:"The Road to Damietta",description:"The Newbury Award-winning author delivers “what may be his finest novel” in this young adult narrative of Saint Francis of Assisi and the Fifth Crusade (Publishers Weekly). Rich in the atmosphere of thirteenth-century Italy, The Road to Damietta offers a fascinating new perspective on the man who became Saint Francis of Assisi: the guileless, joyous man who praised the oneness of nature and sought to bring the world into harmony. Thirteen-year-old Ricca di Montanaro, who secretly loves the young Francis, watches in awe as he disavows his rich father and declares himself a servant of Christ. Following him on his journey, Ricca recounts Francis’s attempt to bring peace amidst the bloodshed of the Fifth Crusade. “Lord, make me an instrument of Thy peace,” he said. “Where there is hatred, let me sow love, where there is injury, pardon; where there is doubt, faith; where there is darkness, light; where there is sadness, joy.” And so he set off on the road to Damietta…",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=O8XtuhqMYMEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2004-10-25",publisher:e,subtitle:a}},{id:3114,attributes:{title:c,description:a,thumbnail:a,authors:[b],firstBook:d,published:"1972-01-01",publisher:a,subtitle:"A Story"}},{id:3115,attributes:{title:"Black Star, Bright Dawn",description:"Bright Dawn must face the challenge of the Iditarod dog sled race alone when her father is injured.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=w54JiKROL-4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2008-01-01",publisher:e,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940925820}}("","Scott O'Dell","The Black Pearl",null,"Houghton Mifflin Harcourt"))